import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";

class Tags extends Component {

    Child = () => {

        let {id} = useParams();

        return (
            id
        );
    }

    render(props) {
        return (
            <Router>
            <div className="tags-container">
                <Link className="clover-light" to={props.tagName}>{props.tagName}</Link>
            </div>
            <Switch>
            <Route path="/:id" component={this.Child} />
            </Switch>
            </Router>
        );
    }
}

export default Tags;
